import axios from 'axios';
import { useEffect, useState } from 'react'
import MediaCard from '../MediaCard/MediaCard';
import Grid from '@mui/material/Grid';



function MediaMap() {


    const [newGalleryItems, setGalleryItems] = useState([]);


    const getGalleryItems = () => {
        axios
            .get('/gallery')
            .then((response) => {
                // console.log('Gallery Items array: ', response);
                setGalleryItems(response.data)
            })
            .catch((error) => {
                console.log('GET ERROR in getGalleryItems: ', error);
            })
    }


    useEffect(() => {
        getGalleryItems();
    }, []);


    return (

        <>

            <div className="container">
                {newGalleryItems.map((galleryItem) => (
                    <MediaCard
                        galleryItem={galleryItem}
                        key={galleryItem.id}
                        id={galleryItem.id}
                        path={galleryItem.path}
                        description={galleryItem.description}
                        // likes={galleryItem.likes}
                        // likeItem={likeItem}
                    />
                ))}
            </div>
        </>
    );
}


export default MediaMap;

<Container sx={{ py: 8 }} maxWidth="md">
{/* End hero unit */}
<Grid container spacing={4}>
  {cards.map((card) => (
    <Grid item key={card} xs={12} sm={6} md={4}>
      <Card
        sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}
      >
        <CardMedia
          component="img"
          sx={{
            // 16:9
            pt: '56.25%',
          }}
          image="https://source.unsplash.com/random"
          alt="random"
        />
        <CardContent sx={{ flexGrow: 1 }}>
          <Typography gutterBottom variant="h5" component="h2">
            Heading
          </Typography>
          <Typography>
            This is a media card. You can use this section to describe the
            content.
          </Typography>
        </CardContent>
        <CardActions>
          <Button size="small">View</Button>
          <Button size="small">Edit</Button>
        </CardActions>
      </Card>
    </Grid>
  ))}
</Grid>
</Container>
